In 5GS, the PDU session is the equivalent of a PDN connection in EPS. The requirements and configurations for a PDN connection throughout this document shall also apply to PDU sessions. For example, in 5GS, the Data Network Name (DNN) is the equivalent of an APN in EPS as specified in 3GPP TS 23.003 [5]. The requirements and configurations for an APN throughout this document shall apply to 5GS as well.
When using the 5GS, a bearer is provided by a 5GS QoS flow. The requirements, procedures, and configurations for a bearer throughout this document, including those stating EPS explicitly (e.g., EPS bearer priority), shall also apply to QoS flows.
The MOs defined in this specification are reused for off-network communication and on-network communication (i.e. UE-to-network relay) for MC service over 5G ProSe with following differences:
-	ProSe direct discovery for public safety shall be replaced with 5G ProSe direct discovery, as specified in 3GPP TS 24.554 [26];
-	ProSe direct communication shall be replaced with 5G ProSe direct communication, as specified in 3GPP TS 24.554 [26];
-	ProSe UE-to-network relay shall be replaced with 5G ProSe UE-to-network relay, as specified in 3GPP TS 24.554 [26];
-	default ProSe Per-Packet Priority (PPPP) is replaced by default 5G ProSe PC5 5QI (PQI) as specified in the present specification; and
-	the discovery group ID is replaced by application layer group ID as specified in the present specification.
